// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <=0.9.0;

contract Payment {
address public owner;
address public tenant; // This is the new variable
uint public rentcollected;
uint public depositamount = 1 ether;

constructor(){
    owner=msg.sender;
}



modifier onlyTenant() {
    require(msg.sender == tenant, "Only the tenant has to pay the security deposit and the rent ");
    _; 
}

modifier onlyOwner() {
    require(msg.sender == owner, "Only the owner can withdraw rent");
    _;
}

function gettennant(address _tennant) onlyOwner public
    {
       tenant=_tennant;
    }


//pay security deposit to the contract.
function paySecurityDeposit() public payable onlyTenant {
    require(msg.value == depositamount, "Deposit amount does not match");

}
//get's contract balance
function getBalance() view public returns(uint){
return address(this).balance; 
} 

//pay rent to the contract,
//the Solidity documentation warns of security
//risks associated with transferring rent directly because the transaction can always
//potentially fail
function payRent() public payable onlyTenant{
    rentcollected +=msg.value;
}

function withdrawRent() public payable onlyOwner{
    require (rentcollected > 0, "No rent available to withdraw");
    payable(owner).transfer(rentcollected);
}
}

